    protected override void OnInitialized() {
        if(string.IsNullOrEmpty(JwtState.Jwt))
            NavigationManager.NavigateTo("login");
        try{
            FetchData();
        } catch (RpcException e) {
            ErrorModalOpen(e);
        } catch(Exception e) {
            ErrorModalOpen(new RpcException(new Status(StatusCode.Internal, e.Message), ""));
        }
